import { useEffect } from "react";
import { loadScript } from "../../../../../globals/constants";

function CoursesPage() {

    const _filterConfig = {
        prefix: "Showing",
        type: "jobs",
        total: "2,150",
        showRange: false,
        showingUpto: ""
